    false,nt"url": null,nt"notes": "The lower Bear River drainage basin consists
    of about 730 square miles (1,890 km 2) in north-central Utah, north of and adjacent
    to Bear River Bay of the Great Salt Lake. An average of about 1,180,000 acre-feet
    (1,460 hm 3) of surface water entered the basin annually during 1960-71; most of
    this water entered in the Bear River and in canals diverted from the Bear River.
    Several streams develop from springs within the drainage basin and both the Bear
    and Malad Rivers gain considerably in flow within the drainage basin, mostly from
    ground-water discharge. An average amount of about 972,000 acre-feet (1,200 hm 3)
    of surface water leaves the drainage basin annually and flows toward the Great Salt
    Lake.",nt"license_title": null,nt"extras": [{ntt"key": "responsible-party",ntt"value":
